script: |
  super -f text -I q11550.spq | sort > q11550.out

inputs:
  - name: q11550.spq
    data: |
      SELECT - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col1 + - + 87 * - - ( - col0 ) + + col0 BETWEEN col0 * + col1 * col2 + - 61 + ( + - col1 ) AND NULL;
  - name: tab1

outputs:
  - name: q11550.out
    data: |
      -14
      -47
      -5
